import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import MainPage from "./MainPage";
import Navbar from "./Navbar";
function App() {
  return(
    <div>
      <Navbar/>
    <BrowserRouter>
      <Routes>
        <Route path='/' element={<MainPage />} />
        <Route path='/results' element={<MainPage />} />
      </Routes>


    </BrowserRouter>
    </div>
  );
}

export default App;
